import React, { useState, useEffect } from 'react';


function homeButton() {
  window.location.replace("/");
}


useEffect(() => {
  const response = fetch("/dal");

  const data = response.json();

  console.log(data);

});


const DalPage = () => {
  return (
    <>
      <h1>
        DFW PAGE!
      </h1>

      <button onClick={this.homeButton()}>
        HomePage
      </button>
    </>
  );
};




export default DalPage;
